import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";

export const ChangePassword: React.FC = () => {
  const [newPassword, setNewPassword] = useState("");
  const navigate = useNavigate();

  useEffect(() => {
    console.log("ChangePassword component mounted");
  }, []);

  const handleSubmit = (event: React.FormEvent) => {
    event.preventDefault();
    console.log("Changing password to:", newPassword);
    // Here you would typically send a request to your backend to change the password
    // After successfully changing the password, you might want to navigate back to the main page
    navigate("/");
  };

  return (
    <>
      <h2>Change Password</h2>
      <form onSubmit={handleSubmit}>
        <label>
          New Password:
          <input
            type="password"
            value={newPassword}
            onChange={(e) => setNewPassword(e.target.value)}
            required
          />
        </label>
        <button type="submit">Change</button>
      </form>
    </>
  );
};
